gK9(){return"English"},
gHq(){return"Sobre"},
gHr(){return"Soy una persona que le gusta ser curiosa: hacer un curso nuevo, aprender un deporte nuevo, tocar un instrumento nuevo. Por alguna raz\xf3n no se detiene ah\xed; necesita ser lo m\xe1s extra\xf1o posible. Si he o\xeddo hablar de algo, o s\xe9 que otra persona lo tiene, dejo de interesarme. Desde las chaquetas moradas que llevo hasta las canciones que escucho, pasando por el software que me gusta hacer; Todo tiene que ser emocionante y hecho de la manera correcta. Soy un \xe1vido pianista, viajero, practicante de kitesurf, buceador, esquiador alpino de traves\xeda, alpinista y cualquier otra cosa que se me ponga por delante. Hablo espa\xf1ol en su mayor parte - sobre todo para encontrar nueva comida para probar. Me encantan las cosas nuevas, pero me encanta volver a mi rutina, a mi casa, a mis amigos y a mi familia.\n\nNo creo que mi inteligencia o mi talento hayan sido decisivos para llevarme a donde estoy hoy. Para m\xed, es mi curiosidad la que me impulsa a seguir adelante. Aunque pueda tener la capacidad de investigar y escribir un art\xedculo exhaustivo sobre el estalinismo, mi curiosidad me implora hacer algo un poco m\xe1s cautivador. No quiero ofender a nadie que haya dedicado su vida al estalinismo, pero personalmente prefiero rastrillar la hierba cortada en tres montones perfectos. En los \xfaltimos tiempos, ya no escasean los ingenieros de software, sino que cualquiera puede construir un sitio web. Mi necesidad de una respuesta me obliga a ser m\xe1s inventivo y a divertirme m\xe1s. Si me dan tiempo, la curiosidad crear\xe1 algo mucho m\xe1s interesante que la habilidad bruta (no es que carezca por completo de ella). Esta p\xe1gina es el ejemplo perfecto. Aunque s\xed, podr\xeda haber hecho la misma p\xe1gina personal que hace todo el mundo, me parece bastante aburrida. Creo que ni siquiera podr\xeda terminar una: probablemente acabar\xeda desvaneci\xe9ndome en algo un poco m\xe1s emocionante, como el almuerzo."},
