gIZ(){return"\u2022 Desarrollo \xe1gil full stack en Java, Flutter, Python, Svelte, y SQL\n\u2022 Dise\xf1\xf3, desarroll\xf3 e imparti\xf3 importantes secciones de VisaGO - la primera aplicaci\xf3n Visa con emisi\xf3n digital dirigida directamente al consumidor y la primera en lograr m\xe1s de 150.000 descargas en 90 d\xedas\n\u2022 Integraci\xf3n con ChatGPT en m\xfaltiples proyectos internos para agilizar los flujos de trabajo de otros equipos"},
gIU(){return"Becario de Ingenier\xeda de Software | may 2022 - ago 2022"},
gIV(){return"\u2022 Dise\xf1o y entrega de una interfaz gr\xe1fica de usuario en C++ para ejecutar secuencias de comandos en un simulador de vuelo, incluida la personalizaci\xf3n en XML\n\u2022 Probado emuladores de cabina e integraci\xf3n de software en Learjets, Gulfstreams y el caza X-62"},
gIW(){return"Desarrollador de software junior | jun 2020 - may 2022"},
gIX(){return"\u2022 Trabaj\xf3 en estrecha colaboraci\xf3n con desarrolladores senior para desarrollar m\xf3dulos frontales en la versi\xf3n de producci\xf3n actual\n\u2022 Env\xedo de funciones PHP, HTML y CSS, y prueba de aplicaciones web localmente y a trav\xe9s de TestFlight"},
gKT(){return"Proyectos"},
gKQ(){return"La Calculadora de Cometas"},
gKP(){return"La calculadora de cometas es un proyecto que me apasiona. Soy un \xe1vido practicante de kitesurf, windsurf y vela. En lo que se diferencian el kitesurf y el windsurf de la vela es en que, dependiendo del viento, los navegantes pueden subir o bajar la vela, cambiando la cantidad de superficie para que nunca se vean desbordados. Las cometas y los windsurf vienen en un tama\xf1o que no se puede cambiar, por lo que tendr\xe1s que comprar otro de diferente tama\xf1o para navegar con otro tiempo. Dada la naturaleza inesperada del tiempo, para poder hacer kitesurf o windsurf en cualquier lugar con regularidad, necesitar\xe1s al menos dos o tres tallas. En esta incertidumbre es donde entra en juego esta web. Teniendo en cuenta el peso del rider y la velocidad actual del viento, puede darte una talla de cometa recomendada en m2. En el futuro, me gustar\xeda ampliarlo para incluir el windsurf, el kite foiling y el wing foiling, pero por ahora, \xa1disfruta del agua!"},
gKS(){return"Simulador Virtual de Buceo"},
gKR(){return"La realidad virtual permite escapar de la vida cotidiana. Permite a los usuarios experimentar un entorno artificial que de otro modo nunca ver\xedan. La realidad virtual no s\xf3lo se utiliza para el entretenimiento, sino que tiene aplicaciones pr\xe1cticas y educativas muy reales. Este proyecto pretende utilizar la realidad virtual para ense\xf1ar a los usuarios algunos de los fundamentos del submarinismo. Al reducir la barrera de entrada, har\xe1 que el buceo sea m\xe1s accesible y, con un poco de suerte, difundir\xe1 el inter\xe9s por \xe9l. El artefacto final es un simulador de submarinismo que demostrar\xe1 lo aplicable que es la RV como m\xe9todo de ense\xf1anza.\n\nEste simulador de submarinismo utiliza aspectos de cursos de buceo reales para hacerlo m\xe1s realista. Utiliza man\xf3metros virtuales basados en instrumentos de buceo reales y anima a los usuarios a aprender su funcionalidad mediante ensayo y error. Ense\xf1ar una materia a trav\xe9s de la realidad virtual hace que se parezca m\xe1s a un juego. Este cambio de punto de vista puede ayudar a los usuarios a comprometerse con la ense\xf1anza y absorber m\xe1s informaci\xf3n.\n\nLos participantes en el estudio de usuarios del simulador coincidieron en que \xe9ste fomentar\xeda la concienciaci\xf3n medioambiental a pesar de no centrarse demasiado en el tema. Al conseguir que m\xe1s gente se interese por el buceo, el simulador podr\xeda contribuir a difundir la implicaci\xf3n en la conservaci\xf3n de los oc\xe9anos. La mayor\xeda de los participantes pudieron aprender m\xe1s sobre el tema y encontraron la experiencia inmersiva e informativa. El proyecto es una buena base para ampliarlo a otros aspectos del buceo o incluso a otros temas. Tambi\xe9n podr\xeda integrarse en diversos cursos de buceo para ayudar a mejorar y agilizar el proceso de aprendizaje."},
